import React from 'react';

const FieldsViewer=({label, handleChange, type="text"})=>{
    return(
        <div>
           <label>{label}:</label>
           <input
            
                type={type}
                 onChange={handleChange}
                >          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
